import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import './App.css';

//components
import InputTodo from "./components/inputTodo";
import ListTodos from "./components/listTodo"; 
function App() {
  return (
    <Router>
       <React.Fragment>
            <div className="container">
          <InputTodo/>
      <ListTodos/>
      </div>
    </React.Fragment>
    </Router>
  );
}

export default App;
